import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

import AddProduct from './pages/AddProduct';

function Routes() {
    return (
        <BrowserRouter>
            <Switch>
                <Route path="/addProduct" component={AddProduct} />
            </Switch>
        </BrowserRouter>
    );
};

export default Routes;
